import React, { Suspense, useEffect, useState } from 'react';
import camiloNodders from './camiloczNodders.gif';
import camiloPillar from './camiloczPillar.gif';
import markyJam from './markynJam.gif';
import './App.css';
import axios from 'axios';
import { Streams } from './Components/Streams';
import { Footer } from './Components/Footer';




const gifEmotes = [
  {
    src: camiloNodders
  },
  {
    src: camiloPillar
  },
  {
    src: markyJam
  }
];


function App() {

  const [randomGif, setRandomGif] = useState('');
  const [loading, setLoadingStatus] = useState(true);
  const [streams, setStreams] = useState([]);

  useEffect(() => {
    const fetchStreams = async () => axios.get('http://localhost:8080/twitch').then((res) => setStreams(res.data));
    fetchStreams();
  }, []);

  return (
    <div className="App">
        <Streams data={streams}/>
        <Footer/>
    </div>
  );
}

export default App;
